import React from 'react';

const styles = {
  container: {
    display: 'flex',
    justifyContent: 'center',
    width: "75%",
    flexWrap: 'wrap',
    color: 'white',
  },
  img: {
    height: '50%',
    width: '100%',
  },
  card: {
    height: 'fit-content',
    width: '45%',
    border: 'white solid 1px',
    margin: '1em',
    borderRadius: '5px',
    padding: '.5em',
  },
  button: {
    padding: '4px',
    borderRadius: "5px"
  }
};

function Repo(props) {
  return (
    <div style={styles.container}>
      {}
      {props.programs.map((project, i) =>
        <div className='cards' style={styles.card} key={project.id}>
            <h4>{project.name}</h4>
          <a href={project.link}>
          <img
            alt={project.name}
            className="img"
            src={project.picture}
            style={styles.img}
          />
          </a>
          <p>{project.info}</p>
          <span>   </span>
          <a href={project.repo}><button style={styles.button}>GitHub Repo</button></a>

        </div>
      )}
    </div>
  );
};

export default Repo;
